接口描述​ 用于根据 ONES GraphQL 查询语句，返回查询结果。 接口地址​ https://{your-host-name}/project/api/project/team/{team-uuid}/items/graphql 请求方式​ POST 请求类型​ application/json 请求参数​ Headers​ 参数名 值类型 描述 Content-Type string 内容类型，传值：application/json Ones-User-Id string 用户 uuid Ones-Auth-Token string 登录接口用户登录成功后返回的 token 信息 Params​ 参数名 值类型 参数位置 必传 描述 team-uuid string In path 是 团队 uuid，可以在用户登录接口的响应结果中获取 Body​ 参数名 值类型 必传 描述 query string 是 ONES GraphQL 查询语句 variables map 否 键值对类型， 作为 GraphQL 查询参数 请求样例​ GraphQL 查询语句 { tasks{ uuid name } } 以上 GraphQL 查询语句对应的 json 接口请求格式为： { "query": "{
 tasks{
 uuid
 name
 }
}", "variables": { "orderBy": { "uuid": "ASC" } } }

curl -X POST \ https://your-host-name/project/api/project/team/BDfDqJU7/items/graphql \ -H 'Content-Type: application/json' \ -H 'Ones-Auth-Token: si83t7NzOvAspJ4L7RhKparuw9FvAsy7z3UupTCiGxhd7zEO2cBIG12vrw31sPRP' \ -H 'Ones-User-Id: 6ZpgEzkk' \ -H 'cache-control: no-cache' \ -d '{"query":"query PRODUCTS($filter: Filter, $orderBy: OrderBy) {
